import React, { useEffect, useState } from 'react';

const Cars = () => {
    const [cars,setCars] = useState([])
    useEffect(()=>{
        fetch('./FakeData.JSON')
        .then(res=>res.json())
        .then(data=>setCars(data))
    },[])

    console.log(cars);

    return (
        <div className="row g-2">
            .col-lg-3
        </div>
    );
};

export default Cars;
